const row = d => {
  d.coords = d['Location Coordinates'].split(',').map(d => +d).reverse();
  d['Total Dead and Missing'] = + d['Total Dead and Missing'];
  d['Reported Date'] = new Date(d['Reported Date']);
  return d;
